import { StatusBar } from "expo-status-bar";
import React, { useEffect, useState } from "react";
import { StyleSheet, Text, View } from "react-native";
import { Provider as PaperProvider } from "react-native-paper";
import { Provider as ReduxProvider } from "react-redux";
import AppbarBottom from "./app/components/AppbarBottom";
import AppBarTop from "./app/components/AppBarTop";
import configureStore from "./app/store/store";
import { getDailyreports } from "./app/api/apiTest";
import { NavigationContainer } from "@react-navigation/native";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import Home from "./app/views/Home";
import Messenger from "./app/views/Messenger";
import Login from "./app/views/Login";
import Register from "./app/views/Register";
import { Ionicons } from "@expo/vector-icons";
import { Entypo } from "@expo/vector-icons";
import { createStackNavigator } from "@react-navigation/stack";

const Tab = createBottomTabNavigator();
const SettingsStack = createStackNavigator();

function SettingsStackScreen() {
  return (
    <SettingsStack.Navigator>
      <SettingsStack.Screen name="Login" component={Login} />
      <SettingsStack.Screen name="Register" component={Register} />
    </SettingsStack.Navigator>
  );
}

export default function App() {
  const [test, setTest] = useState();
  useEffect(() => {
    getDailyreports("v3/967cffba-f2e0-4270-b70f-293e7ee895b1").then(
      (response) => {
        setTest(response.data.test);
        // console.log(response.data);
      }
    );
  }, []);

  return (
    <ReduxProvider store={configureStore}>
      <PaperProvider>
        <NavigationContainer>
          <AppBarTop />
          <Tab.Navigator
            screenOptions={({ route }) => ({
              tabBarIcon: ({ focused, color, size }) => {
                let iconName;

                if (route.name === "Messenger") {
                  iconName = "ios-text";
                } else if (route.name === "Home") {
                  iconName = "md-calendar";
                } else if (route.name === "Login") {
                  return <Entypo name="login" size={24} color={color} />;
                }

                // You can return any component that you like here!
                return <Ionicons name={iconName} size={size} color={color} />;
              },
            })}
            tabBarOptions={{
              activeTintColor: "#1B98E0",
              inactiveTintColor: "gray",
            }}
          >
            <Tab.Screen name="Login" component={SettingsStackScreen} />
            <Tab.Screen name="Home" component={Home} />
            <Tab.Screen name="Messenger" component={Messenger} />
          </Tab.Navigator>
        </NavigationContainer>
        <StatusBar style="auto" />
      </PaperProvider>
    </ReduxProvider>
  );
}
